import * as PropTypes from "prop-types";
import {Logo} from "../components/logo/Logo";

/**
 * Header component
 * @param logoColor
 * @returns {JSX.Element}
 * @constructor
 */
export function Header({logoColor}) {
    return <header className="max-w-7xl w-full mx-auto p-4">
        <Logo />
    </header>
}

Header.propTypes = {logoColor: PropTypes.string};
